KIRTU XXX APARTMENTS EP 12 THE LIBRARIAN An Adult Comic by {(ACF)}


A young, beautiful and charming girl who's just joined Satnam college as the new librarian. She's an avid bibliophile and likes nothing more than spending time surrounded by good books. Besides reading books her hobbies include chatting with friends on the internet and playing internet card games.

But there's more to her than meets the eye. Behind the innocent impression that she gives to everyone she has a naughty side to her as well. She's addicted to reading sex stories on the website indiansexstories and is a big fan of one of the website's most popular story writer, &quot;Big-Tit_Lover.&quot; She had a boyfriend a couple of years ago but has been single for the last two years.
